        axios.get('/querys')
            .then(response => {
                setData(response.data);
                console.log(response.data)
            })
            .catch(error => {
                console.error("Error fetching data: ", error);
                setError(error);
            })

    }, [])

    const cityJson = {
        'citys': {
            "Santiago": 6,
            "Quillota": 1,
            "Valparaiso": 7,
            "Concepción": 2
        }
    }

    return (
        <div className="providerProductsTable__container">
            <Container className="d-flex flex-column gap-3 mt-4">
                <h3> Consulta de radiación UV por ciudad</h3>
                <Table >
                    <thead>
                        <tr>
                            <th >Ciudad</th>
                            <th >Número consultas</th>
                        </tr>
                    </thead>
                    <tbody>
                        {Object.entries(cityJson.citys).map(([key, value]) => (
                            <tr key={key}>
                                <td >{key}</td>
                                <td >{value}</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </Container>
        </div>
    );
}


export default ShowCities;
